import React, {Component} from "react";
import "./Home.css";
import classNames from "classnames";
import merc from "../../public/images/merc_benz_row.jpg"

class Home extends Component {
	render() {
		return (
			<div
				className={classNames(
					"container"
					// "firstSection"
				)}
			>
				<div className={"headerImageWrapper"}>
					<img
						className={"image"}
						src={merc}
						alt={"home-pic"}
					/>
				</div>
				<div className={"outerWrapper"}>
					<div className={"innerWrapper"}>
						<img
							className={"faceImage"}
							alt="pirate"
							src={merc}
						/>
					</div>
				</div>
			</div>
		);
	}
}

export default Home;
